import logo from "./logo.svg";
import "./App.css";
import LandingPage from "./components/LandingPage";
import { Router, Routes } from "react-router-dom";

function App() {
    return (
        <Router>
            <Routes>
                <Rout path="/" element={<LandingPage />} />
            </Routes>
        </Router>
    );
}

export default App;
